        <h1>
          If it it comparable, It is no longer <span>NOVA!</span>
        </h1>
        <button className="order"><p>Order now</p></button>
        <button className="view">View cars</button>
      </div>
      <div className="front-child2">
        <img className="car" src="red_car2.png" alt="" />
      </div>
    </div>
  );
};

export default FrontPage;
